import React from 'react';
import {
	FooterLinkItems,
	FooterLinkTitle,
	FooterLink,
	FooterLogo,
	SocialIcon,
	FooterRights,
	FooterSocialIcon,
	FooterWrapper,
	FooterAddress,
	FooterColumn,
	FooterGrid,
} from './FooterStyles';
import { footerData, footerSocialData } from '../../data/FooterData';
import { Row, Section } from '../../globalStyles';



function Footer() {
	return (
		<Section padding="4rem 0 2rem 0" id="contact">
			<FooterWrapper>
				<FooterGrid justify="space-between">
					<FooterColumn id="footerLogo">
						<FooterLogo to="/">
							<SocialIcon src="./assets/logoinverse.png" alt='KOSHY & CO' />
							KOSHY & CO
						</FooterLogo>
						<FooterAddress>
						   FRN 022223S <br/>
                           Prop: CA Titus Koshy <br/>
                           MRN 254064 <br/>
                           Office: No. 27/2957A1 <br/>
                           K P Vallon Road <br/>
                           Kadavanthra Ernakulam <br/>
                           Kochi - 682020 <br/>
                           Kerala
						</FooterAddress>

						<Row align="center" margin="auto  0 0 0" gap="1rem">
							{footerSocialData.map((social, index) => (
								<FooterSocialIcon
									key={index}
									href={social.tolink}
									target="_blank"
									aria-label={social.name}

								>
									{social.icon}
								</FooterSocialIcon>
							))}
						</Row>
					</FooterColumn>
					{footerData.map((footerItem, index) => (
						<FooterLinkItems key={index}>
							<FooterLinkTitle>{footerItem.title}</FooterLinkTitle>
							{footerItem.links.map((link, linkIndex) => (
								<FooterLink key={linkIndex} to="/">
									{link}
								</FooterLink>
							))}
						</FooterLinkItems>
					))}
				</FooterGrid>
				<FooterRights>KOSHY & CO Â© 2022</FooterRights>
			</FooterWrapper>
		</Section>
	);
}

export default Footer;
